import styled from "styled-components";


const MainContentHolder = styled.div`
  display: grid;
  row-gap: 20px;

  @media screen and (max-width: 1200px) {
    row-gap: 12px;
  }
`;

const ContentGridTwo = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  column-gap: 15px;

  @media screen and (max-width: 992px) {
    grid-template-columns: repeat(2, 1fr);
    row-gap: 12px;

    .grid-two-item:nth-child(3) {
      grid-column-start: 1;
      grid-column-end: 3;
    }

    .grid-two-item:nth-child(3) .subgrid-two {
      grid-template-columns: repeat(2, 1fr);
      height: 220px;
      column-gap: 12px;
    }

    row-gap: 12px;
  }

  @media screen and (max-width: 768px) {
    grid-template-columns: repeat(1, 1fr);
    column-gap: 0;

    .grid-two-item:nth-child(1) {
      grid-column-start: 1;
      grid-column-end: 3;
    }

    .grid-two-item:nth-child(3) .subgrid-two {
      grid-template-columns: repeat(1, 1fr);
      height: auto;
    }

    .grid-two-item:nth-child(3) .subgrid-two .subgrid-two-item {
      height: 220px;
    }
  }
`;

const ContentMain = () => {
  return (
    <MainContentHolder>
      <ContentGridTwo>
        <Budget />
        <CompletedTask />
      </ContentGridTwo>
    </MainContentHolder>
  );
};

export default ContentMain;
